content: |
  At this point, you should have a project that looks something like this when you run it.

  ![1.00](data:image/png;base64,)

  But with lessons it can be easy to get off track at times. If you are having issues with your project, there are a set of files here titled `-checkpoint-1` that have the code needed to get you back up and running. Just check the differences between your files and the checkpoints to get fixed up.

  ![1.00](data:image/png;base64,)

  *RayForce - Used a unique mechanism where you would both shoot directly in front of your ship as well as shoot at enemies in the background layer, as pictured above, using a lock-on homing laser.*
